import React, { Component } from "react";

class Bubble extends Component {
  getNumber(n) {
    if (!n) {
      return "";
    }
    return n > 9 ? "9+" : n;
  }

  render() {
    const { value } = this.props;
    return <span className="n">{this.getNumber()}</span>;
  }
}

export default Bubble;
